import { useState } from "react";
import { runPrompt }from "./GPT/useGPT"

const Terminal = () => {
    const [idea, setIdea] = useState(nul)


    const createIdea = async () => {
        const json = await runPrompt("very hard");
        setIdea(JSON.parse(json))
    }

    return ( 
        <div className="p-10 relative w-5/6 h-5/6 bg-neutral-900 rounded-3xl  border-neutral-900 border-t-8 text-white">
            <p className="p-4">{idea.project}</p>
            <p className="p-4">{idea.languages}</p>
            {idea.frameworks.map((framework) => (
                <p className="p-4">{framework}</p>                
            ))} 
            <p className="">{idea.description}</p>
            {idea.features.map((feature) => (
                    <p>{feature}</p>                
            ))}  
            <p className="">{idea.difficulty}</p>
            <button className="absolute bottom-0 text-4xl pl-4" onClick={() => createIdea()}>Generate New Project Idea</button>
        </div>
     );
}

export default Terminal;
